%[text] # **Techniques for Handling Missing Data**
%[text] In this script we provide an overview of some techniques for handling missing values in a data set.
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Context and motivation.
%[text] ### Why is it important to handle missing data?
%[text] - The presence of missing values could affect the validity of the test, model, or inference.
%[text] - Deleting too many rows with missing values reduces the sample size and therefore the power of any test or model. It may also bias the results.
%[text] - Data may not be missing completely at random. Subgroups within the population may be inadvertently excluded or underrepresented if they are systematically missing data
%[text] - Removing outliers could lead to missing values in the data. \
%[text] ### When can these techniques be used?
%[text] Some techniques are more appropriate for tabular data (e.g., kNN or random forest imputation). Others are applicable to time series (e.g., Brownian bridges). Some techniques are distance-based, and so might need to be applied to a purely numeric data set. For distance-based algorithms, standardizing the variables will likely be needed to avoid inadvertant bias. Other techniques can cope with categorical variables, or a mixed dataset comprising both continuous and categorical variables.
%[text] ### When should these techniques not be used?
%[text] If we have a large dataset with good coverage across all subgroups, then it will be easier and simpler to delete rows with missing data.
%[text] ### Example data
%[text] In this script we work with the credit card dataset that ships with the Financial Toolbox (Refaat 2011). 
%[text] The dataset comprises a set of continuous and categorical variables for a collection of credit cards. The data is labelled, and the final column (`status`) indicates whether the loan payments are in default. 
%[text] Each row of the table holds the data for one credit card, and each column of the table is a feature or variable.
%%
%[text] ## Load the credit card data set.
load( "CreditCardData.mat" )
%[text] Prepare the sample data set containing missing values.
dataMissing.Properties.RowNames = string( dataMissing.CustID );
dataMissing.CustID = [];
dataMissing.status = categorical( dataMissing.status, [0, 1], ["NonDefault", "Default"] );
%[text] Summarize the variables.
head( dataMissing ) %[output:06a22f56]
summary( dataMissing ) %[output:029e7b37]
%[text] If we have nonstandard indicators for missing values in the dataset, first use [`standardizeMissing`](<matlab: doc standardizeMissing>) to obtain a standard set of missing values for each type (i.e., `NaN` for continuous variables and `<undefined>` for categorical variables).
%%
%[text] ## Visualize the missing data pattern.
tf = ismissing( dataMissing );

figure %[output:681a2960]
imagesc( tf ) %[output:681a2960]
xticks( 1 : width( dataMissing ) ) %[output:681a2960]
xticklabels( dataMissing.Properties.VariableNames ) %[output:681a2960]
ylabel( "Customer ID" ) %[output:681a2960]
title( "Missing Data Distribution" ) %[output:681a2960]
%%
%[text] ## Investigate the missing data pattern.
%[text] For any exploratory data analysis or model-building, it's good practice to investigate whether there are underlying trends or patterns in the missing data. This helps to understand and avoid bias in subsequent models. For example, it could be the case that certain subgroups in the data are more likely to exhibit missing values.
%[text] Let's start with `CustAge`.
CustAgeMissing = ismissing( dataMissing.CustAge );
contVars = dataMissing(:, vartype( "numeric" ));
contVars.CustAge = [];
catVars = dataMissing(:, vartype( "categorical" ));
%[text] Use a two-sample t-test ([`ttest2`](<matlab: doc ttest2>)) to determine whether there is any significant difference between the missing and nonmissing subgroups across each of the continuous variables.
for k = width( contVars ) : -1 : 1
    contpCustAge(k) = ttest2( CustAgeMissing, contVars{:, k} );    
end % for

disp( "Continuous variables with significant differences between missing and nonmissing CustAge subgroups:" ) %[output:9be3ee78]
disp( contpCustAge < 0.05 ) %[output:7c0132e0]
%[text] Use a similar procedure via [`crosstab`](<matlab: doc crosstab>) to investigate the categorical variables.
for k = width( catVars ) : -1 : 1
    [~, ~, catpCustAge(k)] = crosstab( CustAgeMissing, catVars{:, k} );
end

disp( "Categorical variables with significant differences between missing and nonmissing CustAge subgroups:") %[output:05b482b4]
disp( catpCustAge < 0.05 ) %[output:649e48a7]
%[text] Repeat the process for `ResStatus`.
ResStatusMissing = ismissing( dataMissing.ResStatus );
contVars = dataMissing(:, vartype( "numeric" ));
catVars = dataMissing(:, vartype( "categorical" ));
catVars.ResStatus = [];

for k = width( contVars ) : -1 : 1
    contpResStatus(k) = ttest2( CustAgeMissing, contVars{:, k} );     
end % for
disp( "Continuous variables with significant differences between missing and nonmissing ResStatus subgroups:" ) %[output:75f196c5]
disp( contpResStatus < 0.05 ) %[output:26d79c8b]
for k = width( catVars ) : -1 : 1
    [~, ~, catpResStatus(k)] = crosstab( CustAgeMissing, catVars{:, k} );
end
disp( "Categorical variables with significant differences between missing and nonmissing ResStatus subgroups:") %[output:668810ef]
disp( catpResStatus < 0.05 ) %[output:51ade2fc]
%[text] Cross-tabulate the missing values for the two variables.
[~, ~, pmiss] = crosstab( CustAgeMissing, ResStatusMissing );
disp( "Significant dependence between the missing values in CustAge and ResStatus:" ) %[output:32496c7b]
disp( pmiss < 0.05 ) %[output:6b88b889]
%[text] In this example, we can conclude that the data is missing completely at random (MCAR) - the probability of any observation being missing is uniform.
%[text] For other data sets, we might conclude that the data is:
%[text] - missing at random (MAR): the probability of being missing is uniform after controlling for group membership in the observed data.
%[text] - missing not at random (MNAR): the missing data pattern is neither MCAR nor MAR. \
%%
%[text] ## Rowwise deletion.
%[text] By far the most common method of handling missing data is to simply remove it. To preserve the tabular structure of the dataset, this means removing all the rows that contain at least one missing value. 
%[text] This method is simple and quick to implement, and could work well for large datasets with good coverage of different subgroups.
%[text] On the other hand, it has the potential to throw away valid data, and can introduce bias if the data is MNAR. It also reduces the power of subsequent tests or models, by reducing the effective sample size.
%[text] See [`rmmissing`](<matlab: doc rmmissing>).
%%
%[text] ## Impute missing data using $k$-nearest neighbors.
%[text] A powerful method for imputing missing values is to use the $k$-nearest neighbors (kNN) algorithm. The idea is that for a given row containing a missing value, we find the $k$ closest observations to the given row. If the missing value is categorical, then we use the majority vote from the corresponding categories in the nearest neighbors. If the missing value is continuous, we use the mean of the corresponding values in the nearest neighbors. In this example we use [`fitcknn`](<matlab: doc fitcknn>), which as a classifier, is designed to predict categorical values. See also [`knnimpute`](<matlab: doc knnimpute>).
%[text] The kNN algorithm depends on the choice of a distance metric between observations (rows) in the dataset.
%[text] We have both continuous and categorical variables in the dataset, so let's first convert the categorical variables to numeric variables.
custAgeToImpute = dataMissing;
custAgeToImpute = convertvars( custAgeToImpute, @iscategorical, @double );
%[text] Fit the kNN model.
k = 15;
[custAgeToImputeZ, mu, sigma] = normalize( custAgeToImpute{:, :}, "zscore" );
imputedZ = knnimpute( custAgeToImputeZ.', k, "Distance", "euclidean" ).';
custAgeImputedKNN = sigma .* imputedZ + mu;

imputedCustAgeKNN = custAgeToImpute.CustAge;
tf = ismissing( imputedCustAgeKNN );
imputedCustAgeKNN(tf) = custAgeImputedKNN(tf, 1);
%[text] Repeat the process for `ResStatus`.
resStatusToImpute = dataMissing;
resStatusToImpute = convertvars( resStatusToImpute, ["EmpStatus", "OtherCC", "status"], @double );
knnModelResStatus = fitcknn( resStatusToImpute, "ResStatus", ...
    "NumNeighbors", k, ...
    "Standardize", true, ...
    "Distance", "euclidean" );

imputedResStatusKNN = resStatusToImpute.ResStatus;
tf = ismissing( imputedResStatusKNN );
imputedResStatusKNN(tf) = predict( knnModelResStatus, resStatusToImpute(tf, :) );
%[text] Combine the results into one table.
imputedDataKNN = dataMissing;
imputedDataKNN(:, ["CustAge", "ResStatus"]) = table( imputedCustAgeKNN, imputedResStatusKNN );
%%
%[text] ## Compare the imputed data with the original data.
figure %[output:0449c3a1]
tiledlayout( "horizontal" ) %[output:0449c3a1]

nexttile %[output:0449c3a1]
histogram( dataMissing.CustAge ) %[output:0449c3a1]
hold on %[output:0449c3a1]
histogram( imputedDataKNN.CustAge ) %[output:0449c3a1]
xlabel( "CustAge" ) %[output:0449c3a1]
ylabel( "Count" ) %[output:0449c3a1]
title( "CustAge Histogram" ) %[output:0449c3a1]
grid on %[output:0449c3a1]
legend( "Original", "Imputed" ) %[output:0449c3a1]

nexttile %[output:0449c3a1]
qqplot( dataMissing.CustAge, imputedDataKNN.CustAge ) %[output:0449c3a1]
xlabel( "Original Quantiles" ) %[output:0449c3a1]
ylabel( "Imputed Quantiles" ) %[output:0449c3a1]
title( "CustAge QQ-Plot" ) %[output:0449c3a1]
grid on %[output:0449c3a1]

nexttile %[output:0449c3a1]
[origF, origx] = ecdf( dataMissing.CustAge );
[impF, impx] = ecdf( imputedDataKNN.CustAge );
plot( origx, origF, "LineWidth", 2 ) %[output:0449c3a1]
hold on %[output:0449c3a1]
plot( impx, impF, "LineWidth", 2 ) %[output:0449c3a1]
xlabel( "CustAge" ) %[output:0449c3a1]
ylabel( "Cumulative Probability" ) %[output:0449c3a1]
title( "CustAge ECDF" ) %[output:0449c3a1]
grid on %[output:0449c3a1]
legend( "Original", "Imputed" ) %[output:0449c3a1]
%[text] Perform a hypothesis test:
h = kstest2( dataMissing.CustAge, imputedDataKNN.CustAge );
disp( "Test decision (reject the null that the two distributions are the same): " + h ) %[output:125b0b8b]
%[text] Compare the original and imputed residential status.
figure %[output:5161228d]
histogram( dataMissing.ResStatus ) %[output:5161228d]
hold on %[output:5161228d]
histogram( imputedDataKNN.ResStatus ) %[output:5161228d]
xlabel( "ResStatus" ) %[output:5161228d]
ylabel( "Count" ) %[output:5161228d]
title( "ResStatus Histogram" ) %[output:5161228d]
grid on %[output:5161228d]
legend( "Original", "Imputed" ) %[output:5161228d]
%%
%[text] ## Model-based imputation.
%[text] Let's now look at other model-based techniques for imputation. A simple case is using a constant value, such as a descriptive statistic, to fill in the missing values in a variable.
meanAge = mean( dataMissing.CustAge, "omitmissing" );
filledAge = fillmissing( dataMissing.CustAge, "constant", meanAge );
%[text] This technique is simple and preserves the mean.
%[text] For a categorical variable the analogous method is to use the most frequent value.
modeResStatus = mode( dataMissing.ResStatus );
filledResStatus = fillmissing( dataMissing.ResStatus, "constant", modeResStatus );
%[text] This approach can be extended to a predictive model that uses the information from the nonmissing values to provide a more accurate prediction of the missing value. Common models include linear regression (using [`fitlm`](<matlab: doc fitlm>)) and random forests (using [`fitrensemble`](<matlab: doc fitrensemble>) and [`fitcensemble`](<matlab: doc fitcensemble>)).
%[text] Let's look at the random forest approach. We first create a weak learner (a single tree) to use as the basis of the random forest. Since multiple predictors may contain missing values, it's a good idea to specify the `Surrogate` option as `"on"`. This means that if the top-level decision variable in the tree has a missing value, a substitute (surrogate) variable will be used instead.
rng( "default" )
weakLearner = templateTree( "Surrogate", "on", "Reproducible", true );
%[text] Create a random forest to predict `CustAge`.
custAgeForest = fitrensemble( dataMissing, "CustAge", ...
    "Method", "bag", ...
    "NumLearningCycles", 100, ...
    "Learners", weakLearner );

imputedCustAgeForest = dataMissing.CustAge;
tf = ismissing( imputedCustAgeForest );
imputedCustAgeForest(tf) = predict( custAgeForest, dataMissing(tf, :) );
%[text] Do the same for `ResStatus`.
resStatusForest = fitcensemble( dataMissing, "ResStatus", ...
    "Method", "bag", ...
    "NumLearningCycles", 100, ...
    "Learners", weakLearner );

imputedResStatusForest = dataMissing.ResStatus;
tf = ismissing( imputedResStatusForest );
imputedResStatusForest(tf) = predict( resStatusForest, dataMissing(tf, :) );
%[text] Combine the results into one table.
imputedDataForest = dataMissing;
imputedDataForest(:, ["CustAge", "ResStatus"]) = table( imputedCustAgeForest, imputedResStatusForest );
%[text] Notes:
%[text] - In contrast to `fitcknn`, the predicted values for `CustAge` from the random forest are not necessarily integers. These values could be rounded if necessary.
%[text] - It might be desirable to add suitable noise to the imputed values. If a linear regression model is used to impute the missing values, then the imputed values would lie exactly on the regression surface. \
%%
%[text] ## Alternating least squares.
%[text] Alternating least squares(ALS) is a matrix factorization technique that can be used to estimate missing values in a numeric matrix. One specific application of ALS is developing a recommendation system connecting users and items.
%[text] The starting point is a large matrix $R$ containing the users (rows) and items (columns). The elements of the matrix $R\_{ij}$ represent the rating, or score, assigned by user $i$ to item $j$. The matrix $R$ is highly sparse because a given user has only rated a small number of items. Due to the high level of sparsity, traditional clustering algorithms such as $k$-means are not suitable for predicting the missing ratings.
%[text] The objective is to factorize $R$ into a product $UV$, where $U$ is a $n\_U$-by-$k$ matrix and $V$ is a $k$-by-$n\_I$ matrix, where $n\_U$ is the number of users and $n\_I$ is the number of items. The assumption is that the users' preferences can be expressed in terms of a smaller number, $k$, of hidden or latent factors. For example, if $k=1$ then the items are essentially ranked by overall popularity. 
%[text] This can be expressed as an optimization problem: minimize $||R-UV||\_F$, where $||\\cdot||\_F$ is the Frobenius norm. To prevent overfitting and ill-conditioning, it makes sense to constrain the magnitude of the entries of $U$ and $V$. This can be achieved by including a regularization term in the optimization objective:
%[text] $||R-UV||\_F + \\lambda(||U||\_F + ||V||\_F)$
%[text] This objective function is not convex, but when $U$ (or $V$) is fixed and the problem is solved for $V$ (or $U$), then the problem becomes convex (and a least-squares problem). If we alternate between solving for $U$ and $V$, then we can obtain convergence.
%[text] See [`pca`](<matlab: doc pca>) and [`nnmf`](<matlab: doc nnmf>).
alsData = dataMissing;
alsData = convertvars( alsData, @iscategorical, @double );
[V, S, ~, ~, ~, mu] = pca( alsData{:, :}, "Algorithm", "als" );
%[text] Reconstruct the data.
reconstructedData = mu + S * V.';
filledDataALS = dataMissing;
tf = ismissing( dataMissing.CustAge );
filledDataALS.CustAge(tf) = reconstructedData(tf, 1);
tf = ismissing( dataMissing.ResStatus );
filledDataALS.ResStatus(tf) = categorical( round( reconstructedData(tf, 3) ), 1:3, ["Home Owner", "Tenant", "Other"] );
%%
%[text] ## Time-series methods: Brownian bridges.
%[text] See [`Seminar03_BrownianBridgeExamples`](<matlab: edit("Seminar03_BrownianBridgeExamples")>).
%%
%[text] ## Data synthesization.
%[text] We'll look at two methods for synthesizing data. Data synthesization could be useful in situations such as model exploration or training, and for faster generation compared to running a large Simulink model. We might also need to have a reproducible, nonsensitive dataset for sharing with external colleagues.
%[text] It's straightforward to generate simulated random values from a univariate distribution (see [`fitdist`](<matlab: doc fitdist>), [`makedist`](<matlab: doc makedist>), and [`random`](<matlab: doc random>)), but things are less straightforward when correlated samples are required.
%[text] ### Copulas
%[text] With this approach, we model the joint distribution of multiple continuous variables. The resulting distribution can then be used to simulate random values which have the same distributional properties as the original data.
%[text] As an example, let's model `CustAge` and `CustIncome`.
figure %[output:8990c50e]
scatter( data.CustAge, data.CustIncome, "." ) %[output:8990c50e]
xlabel( "CustAge" ) %[output:8990c50e]
ylabel( "CustIncome" ) %[output:8990c50e]
title( "Income vs. Age" ) %[output:8990c50e]
grid on %[output:8990c50e]
%[text] First, we need to fit the marginal distributions for age and income.
ageFit = fitdist( data.CustAge, "Kernel" );
incomeFit = fitdist( data.CustIncome, "Kernel" );
%[text] Transform the data to the unit square $U=\[0, 1\]\\times\[0, 1\]$.
U(:, 1) = cdf( ageFit, data.CustAge );
U(:, 2) = cdf( incomeFit, data.CustIncome );
%[text] Fit a $t$-copula.
[rho, DoF] = copulafit( "t", U );
%[text] Use the copula to generate random samples.
simU = copularnd( "t", rho, DoF, 2000 );
%[text] Back-transform the simulated values into CustAge/CustIncome space.
simAgeIncome(:, 1) = icdf( ageFit, simU(:, 1) );
simAgeIncome(:, 2) = icdf( incomeFit, simU(:, 2) );
%[text] Inspect the simulated values.
figure %[output:01167894]
scatter( simAgeIncome(:, 1), simAgeIncome(:, 2), "." ) %[output:01167894]
xlabel( "Simulated CustAge" ) %[output:01167894]
ylabel( "Simulated CustIncome" ) %[output:01167894]
title( "Simulated (Age, Income) Samples" ) %[output:01167894]
grid on %[output:01167894]
